            type:'GET',
            dataType:'text',
                success: function(data) {
                    results = JSON.parse(data);
                    $list.html('');
                    var items = '';
                    for(i in results)
                    { items += '<option value=""' + results[i].value + '"">' + results[i].text + '</option>'; }
                    
                    $list.html(items);
                }

            
            });         
        }
           $(document).ready(function() {
                updatesubcatlist(); 
            });
            $('#selectlistcategories').on(""change"", function() {
                updatesubcatlist(); 
            });
